import styled from 'styled-components';

const CheckoutStyles = styled.ul`
  width: 80vw;
  padding: 10px;
  margin: 10px;
  #form {
    grid-column: 2;
    width: 100%;
    margin-top: 10vh;
    margin-bottom: 30vh;
    padding: 25px;
    padding-right: 50px;
    border: solid black 2px;
    border-radius: 10px;
  }
`;

export default CheckoutStyles;
